import React from "react";
import SelectBakavd from "./SelectBakavd";

function NyPatientForm({
  handleSubmitNypatient,
  inPlats,
  setInPlats,
  inKontakt,
  setInKontakt,
  inDatum,
  setInDatum,
  initialer,
  setInitialer,
  inAvd,
  setInAvd,
}) {
  return (
    <div className="card">
      <form onSubmit={handleSubmitNypatient}>
        <div className="form-container">
          <div className="va-container">
            <input
              type="text"
              value={inPlats}
              placeholder="sÃ¤ngplats..."
              onChange={(e) => setInPlats(e.target.value)}
            />
            <input
              type="text"
              value={inKontakt}
              placeholder="FVK"
              onChange={(e) => setInKontakt(e.target.value)}
            />
            <input
              type="text"
              value={initialer}
              placeholder="Initialer..."
              onChange={(e) => setInitialer(e.target.value)}
            />
          </div>
          <div className="ho-container">
            <input
              type="date"
              value={inDatum}
              onChange={(e) => setInDatum(e.target.value)}
            />
            <span>
              <SelectBakavd setInAvd={setInAvd} />
            </span>
            <input />
          </div>
        </div>
        <div className="btn-container">
          <button type="submit">Spara</button>
        </div>
      </form>
    </div>
  );
}

export default NyPatientForm;
